import type { UserOAuthService } from "@whop-sdk/core/node/services/UserOAuthService";
import { cache } from "react";

/**
 * helper to check if a user owns a certain product,
 * @returns the membership of the matched product.
 */
const findProduct = async (
  sdk: UserOAuthService,
  allowedProducts: string | string[]
) => {
  if (typeof allowedProducts === "string") allowedProducts = [allowedProducts];
  const memberships = (await sdk.listUsersMemberships({ valid: true })).data;
  return (
    memberships?.find(
      (membership) =>
        membership.product && allowedProducts.includes(membership.product)
    ) || null
  );
};

export default findProduct;

/**
 * wrapped findProduct in React.cache for use in the
 * app directory
 */
export const cached = cache(findProduct);

import { useEffect, useState } from "react";

const getPurchaseLink = (
  plan: string,
  redirect: string,
  location: URL | string
) => {
  const href = new URL(`https://whop.com/checkout/${plan}/`);
  const onSuccess = new URL(redirect, location);
  href.searchParams.set("onSuccess", onSuccess.href);
  return href;
};

export const usePurchaseLink = (plan: string, redirect?: string) => {
  const [purchaseLink, setPurchaseLink] = useState(
    `https://whop.com/checkout/${plan}/`
  );

  useEffect(() => {
    const fullLink = getPurchaseLink(
      plan,
      redirect || window.location.pathname,
      window.location.origin
    );
    if (purchaseLink !== fullLink.href) setPurchaseLink(fullLink.href);
  }, [purchaseLink, plan, redirect]);

  return purchaseLink;
};

export default getPurchaseLink;

