/**
 * this uses the context to get the user-scoped SDK and then uses the SDK to fetch
 * the users profile. If the user is not logged in they will be redirected to /ssr.
 */
export const getServerSideProps: GetServerSideProps<{ user: User }> = async ({
  req,
  res,
}) => {
  const { sdk } = await getSdk(req, res);
  if (!sdk)
    return {
      redirect: {
        destination: "/ssr",
        permanent: false,
      },
    };
  const user = await sdk.retrieveProfile({});
  return {
    props: { user },
  };
};

import getSdk from "@/lib/get-user-sdk/middleware";
import withAuth from "next-auth/middleware";
import { NextResponse } from "next/server";
import getPurchaseLink from "./lib/get-purchase-link";
import findProduct from "./lib/has-product";

const ALLOWED_PRODUCTS: string[] =
  process.env.NEXT_PUBLIC_REQUIRED_PRODUCT?.split(",") || [];
const RECOMMENDED_PLAN = process.env.NEXT_PUBLIC_RECOMMENDED_PLAN_ID || "";

export default withAuth(async (req) => {
  const { sdk } = getSdk(req);
  const isApp = req.nextUrl.pathname.startsWith("/app");
  if (!sdk)
    return NextResponse.redirect(
      new URL(isApp ? "/app/ssr" : "/ssr", req.nextUrl.origin)
    );

  const membership = await findProduct(sdk, ALLOWED_PRODUCTS);
  if (membership) return NextResponse.next();
  return NextResponse.redirect(
    getPurchaseLink(RECOMMENDED_PLAN, req.nextUrl.pathname, req.nextUrl)
  );
});

export const config = {
  matcher: ["/app/ssg/product-gated", "/ssg/product-gated"],
};

import type { NextAuthOptions } from "next-auth";

export const authOptions: NextAuthOptions = {
  providers: [
    {
      id: "whop",
      name: "Whop",
      type: "oauth" as const,
      authorization: "https://whop.com/oauth",
      token: "https://data.whop.com/api/v3/oauth/token",
      userinfo: "https://data.whop.com/api/v2/me",
      clientId: process.env.NEXT_PUBLIC_WHOP_CLIENT_ID,
      clientSecret: process.env.WHOP_CLIENT_SECRET,
      allowDangerousEmailAccountLinking: true,
      profile(profile: {
        id: string;
        username: string;
        email: string;
        profile_pic_url: string;
      }) {
        return {
          id: profile.id,
          name: profile.username,
          email: profile.email,
          image: profile.profile_pic_url,
        };
      },
    },
  ],
  callbacks: {
    async session({ session, user, token }) {
      session.user.id = token.id as string;
      session.accessToken = token.accessToken as string;
      return session;
    },
    async jwt({ token, user, account, profile, isNewUser }) {
      if (user) {
        token.id = user.id;
      }
      if (account) {
        token.accessToken = account.access_token;
      }
      return token;
    },
  },
};
